import {useState, useEffect} from 'react'
import './style/HomePage.css'

function Home(){
  const [list, setList] = useState([])

  useEffect(() => {
    fetch("http://localhost:5001/api")
    .then(response => response.json())
    .then(list => setList(list))
  })

  return(
    <>
      <div>
        {
          list.map(item => (
            <div className='list_item'>
              <h3>{item[1]}</h3>
              <p>{item[2]}</p>
              {
                JSON.parse(item[3]) != null && JSON.parse(item[3]).length != 0 ? (
                  JSON.parse(item[3]).map(elem => (
                    <img src={elem.link} className='photo'/>
                  ))
                ) : (
                  <div>No Photo</div>
                )
              } 
            </div>
          ))
        }
      </div>
    </>
  )

}

export default Home;
